    <div>
      <h1>Reservation</h1>
      <div className='center'>
        <BsFillArrowLeftCircleFill />
        {date}
        <BsFillArrowRightCircleFill onClick={() => addDays(date, 1)} style={{cursor:'pointer'}}/>
